INSERT INTO `faqs` VALUES (1,1,'Why should I sell on :marketplace?','There are many reasons to sell on :marketplace. We have our customers who can see your products to the ability to start selling fast without the need to create a new standalone website. You spend no time and money to do marekting, We do it for you!','2021-03-09 02:25:52','2021-03-09 02:25:52'),(2,1,'Where else can I learn about how selling on :marketplace works?','We have videos, web docs, and blogs to help you find what you need.<ul><li>Getting Started page</li><li>Training and tutorials</li><li>Blog</li></ul>','2021-03-09 02:25:52','2021-03-09 02:25:52'),(3,1,'Can I close my account?','If you want to close your account permanently, Seller Support can assist you. Keep in mind that you can use the Maintenance mode feature that will hide all your listings, or you can deactivate or remove your listings entirely but hold on to your account for future use. Before you close your account permanently, please cancel and remove your listings and resolve all transactions.','2021-03-09 02:25:52','2021-03-09 02:25:52'),(4,2,'How do I manage my merchant account?','Use will get access to a full featured Merchant Dashboard to manage all aspects of selling on :marketplace, like manage your selling account, add product information, make inventory updates, manage orders, and manage users.','2021-03-09 02:25:52','2021-03-09 02:25:52'),(5,2,'How many items i can add on my inventory?','It depends on which sbscription you choose. Please visit the pricing section for detail.','2021-03-09 02:25:52','2021-03-09 02:25:52'),(6,2,'How will I know when I have a sale?',':marketplace notifies you by email when you receive an order. You can change the notification settings in your account settings.','2021-03-09 02:25:52','2021-03-09 02:25:52'),(7,2,'Can I offer gift-wrap and packaging services to my customers?','Yes. Our packaging service allows customers to choose when they check out, you can make the options available for any individual item on your listing page.','2021-03-09 02:25:52','2021-03-09 02:25:52'),(8,3,'How much does it cost to sell on :marketplace?',':marketplace offers different selling plans for a monthly subscription fee plus per-item selling fees, which vary by subscriptions. Please visit the pricing section for detail.','2021-03-09 02:25:52','2021-03-09 02:25:52'),(9,3,'Is there any hidden cost?','No','2021-03-09 02:25:52','2021-03-09 02:25:52');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
