INSERT INTO `payment_methods` VALUES (1,'paypal-express','PayPal Express Checkout',1,'PayPal Inc.','https://www.paypal.com/','https://www.paypal.com/us/webapps/mpp/express-checkout',NULL,'Add PayPal as a payment method to allow customers to checkout with PayPal. Express Checkout offers the ease of convenience and security of PayPal, can turn more shoppers into buyers. You must have a PayPal business account to activate this payment method. - You must have a PayPal business account.<br/><strong>To activate PayPal Express: </strong><br/>- You must have a PayPal business account to accept payments.<br/>- Create an app to receive API credentials for testing and live transactions.<br/>- Go to this link to create your app: <small>https://developer.paypal.com/webapps/developer/applications/myapps</small>',NULL,'Add PayPal as a payment method to any checkout with Express Checkout. Express Checkout offers the ease of convenience and security of PayPal, can be set up in minutes and can turn more shoppers into buyers.','https://developer.paypal.com/docs/integration/direct/express-checkout/integration-jsv4/',0,1,'2021-03-09 02:25:52','2021-03-13 20:35:42'),(2,'stripe','Stripe',2,'Stripe Inc.','https://stripe.com/','https://stripe.com/docs/checkout/tutorial',NULL,'Stripe is one of the best and safe option to charge credit and debit cards around the world. Stripe has a simple fee structure and no hidden costs. No other gateway or merchant account is required. <br/><strong>By using Stripe: </strong><br/>- You have to connect our platform to your Stripe account. <br/>- You agree to Stripe\'s <a href=\"https://stripe.com/us/privacy\" target=\"_blank\">Terms of Service</a>.',NULL,'Stripe is one of the best and safe option to charge credit and debit cards around the world. Stripe has a product for marketplace like this. To enable Stripe to your vendors, you must have to register your platform with Stripe.<br/><strong> Follow This Simple steps:</strong><br/>- Create an Stripe application using the bellow information. <a href=\"https://stripe.com/docs/connect/quickstart\" target=\"_blank\">Check their documentation for help.</a><br/>- Update the .env file on your server with Stripe API credentials.<br/><br/><strong>Remember </strong> when you register your platform use this information: <br/>- Name: \'Alakba\'<br/>- Website URL: \'https://alakba.com\'<br/>- Redirect URL: \'https://alakba.com/admin/setting/stripe/redirect\'','https://stripe.com/docs/connect/quickstart',1,2,'2021-03-09 02:25:52','2021-03-09 02:25:52'),(3,'authorize-net','Authorize.Net',2,'Authorize.Net','https://www.authorize.net/','https://www.authorize.net/support/',NULL,'More solutions for your business. More support when you need it. More strength to stand on. <br/><strong>By using Authorize.Net: </strong><br/>- You have to have an Authorize.Net account. <br/>- You agree to Authorize.Net\'s <a href=\"https://www.authorize.net/about-us/terms/\" target=\"_blank\">Terms of Use</a>.',NULL,'Authorize.Net helps makes it simple to accept electronic and credit card payments.','https://www.authorize.net/about-us/',0,3,'2021-03-09 02:25:52','2021-03-13 20:35:46'),(4,'cybersource','CyberSource',2,'CyberSource','https://cybersource.com/','https://www.cybersource.com/',NULL,'CyberSource is an E-commerce credit card payment system management company. Customers process online payments, streamline online fraud management, and simplify payment security. <br/><strong>By using CyberSource: </strong><br/>- You have to have your CyberSource account. <br/>- You agree to CyberSource\'s <a href=\"https://usa.visa.com/legal/privacy-policy.html\" target=\"_blank\">Terms of Service</a>.',NULL,'CyberSource is one of the most popular and Multi-Channel Payment Gateway.','https://developer.cybersource.com/api/developer-guides/dita-gettingstarted/registration.html',0,4,'2021-03-09 02:25:52','2021-03-13 20:35:48'),(5,'instamojo','Instamojo',2,'Instamojo Technologies Pvt. Ltd.','https://instamojo.com/','https://instamojo.com/docs/checkout/tutorial',NULL,'Instamojo is one of the most popular and Multi-Channel Payment Gateway for India - Accept Credit/Debit Cards, Wallets, Net Banking, UPI & EMI. <br/><strong>By using Instamojo: </strong><br/>- You have to have your Instamojo business account. <br/>- You agree to Instamojo\'s <a href=\"https://www.instamojo.com/terms/\" target=\"_blank\">Terms of Service</a>.',NULL,'Instamojo is one of the most popular and Multi-Channel Payment Gateway for India - Accept Credit/Debit Cards, Wallets, Net Banking, UPI & EMI. Enable Instamojo to your vendors.','https://www.instamojo.com/',0,5,'2021-03-09 02:25:52','2021-03-13 20:35:50'),(6,'paystack','Paystack',4,'Paystack','https://paystack.com/','https://paystack.helpscoutdocs.com/',NULL,'Modern online and offline payments for Africa. Paystack helps businesses in Africa get paid by anyone, anywhere in the world. <br/><strong>By using Paystack: </strong><br/>- You agree to Paystack\'s <a href=\"https://paystack.com/terms\" target=\"_blank\">Terms of Service</a>.',NULL,'Modern online and offline payments for Africa. Paystack helps businesses in Africa get paid by anyone, anywhere in the world.','https://paystack.helpscoutdocs.com/',0,1,'2021-03-09 02:25:52','2021-03-13 20:35:56'),(7,'cod','Cash On Delivery',3,'Cash on Delivery',NULL,NULL,NULL,'Cash on delivery (COD), sometimes called collect on delivery, is the sale of goods by mail order where payment is made on delivery rather than in advance.',NULL,'Cash on delivery (COD), sometimes called collect on delivery, is the sale of goods by mail order where payment is made on delivery rather than in advance.','',1,5,'2021-03-09 02:25:52','2021-03-09 02:25:52'),(8,'wire','Bank Wire Transfer',3,'Pay by bank wire transfer',NULL,NULL,NULL,'Pay by bank wire transfer,  transfer the invoice amount via wire tranfer to the merchant account and confirm manually. After payment confirmation the goods will be shipped.',NULL,'Pay by bank wire transfer,  transfer the invoice amount via wire tranfer to the merchant account and confirm manually. After payment confirmation the goods will be shipped.','',1,6,'2021-03-09 02:25:52','2021-03-09 02:25:52');
